import React, { useState, useEffect } from 'react';
import axios from 'axios';
import styles from './YourStyles.module.css'; // ajuste conforme necessário

export function Register() {
  const [gestorName, setGestorName] = useState('');
  const [password, setPassword] = useState('');
  const [nameCompany, setNameCompany] = useState('');
  const [email, setEmail] = useState('');
  const [province, setProvince] = useState('');
  const [streetAddress, setStreetAddress] = useState('');
  const [nifEmpresa, setNifEmpresa] = useState('');
  const [actuacao, setActuacao] = useState('');
  const [telefone, setTelefone] = useState('');
  const [areasAtuacaoData, setAreasAtuacaoData] = useState({ areas: [] });
  const [showSuccessModal, setShowSuccessModal] = useState(false);
  const [showErrorModal, setShowErrorModal] = useState(false);

  useEffect(() => {
    // Simula uma chamada à API para buscar as áreas de atuação
    axios.get('http://localhost:3001/areas-atuacao')
      .then(response => {
        setAreasAtuacaoData(response.data);
      })
      .catch(error => {
        console.error('Erro ao buscar as áreas de atuação:', error);
      });
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = {
      gestorName,
      password,
      nameCompany,
      email,
      province,
      streetAddress,
      nifEmpresa,
      actuacao,
      telefone,
    };

    axios.post('http://localhost:3001/register', data)
      .then(response => {
        setShowSuccessModal(true);
      })
      .catch(error => {
        setShowErrorModal(true);
      });
  };

  return (
    <>
      <section>
        <div className="py-12 bg-gray-800 min-h-screen">
          <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
            <div className="lg:text-center">
              <h2 className="text-lg font-semibold text-white">Registrar</h2>
            </div>
            <div className="mt-10">
              <div className="bg-gray-700 shadow overflow-hidden sm:rounded-lg">
                <form onSubmit={handleSubmit} className="space-y-6 p-6">
                  <div className="border-b border-gray-200 pb-6">
                    <div className="grid grid-cols-1 gap-y-6 sm:grid-cols-6 sm:gap-x-6">
                      <div className="sm:col-span-3">
                        <label htmlFor="gestorName" className="block text-sm font-medium leading-6 text-white">Nome do Gestor</label>
                        <div className="mt-2">
                          <input type="text" name="gestorName" id="gestorName" value={gestorName} onChange={(e) => setGestorName(e.target.value)} required autoComplete="name" className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm placeholder:text-gray-400 focus:ring-transparent sm:text-sm sm:leading-6"/>
                        </div>
                      </div>
                      <div className="sm:col-span-3">
                        <label htmlFor="nameCompany" className="block text-sm font-medium leading-6 text-white">Nome da Empresa</label>
                        <div className="mt-2">
                          <input type="text" name="nameCompany" id="nameCompany" value={nameCompany} onChange={(e) => setNameCompany(e.target.value)} required autoComplete="organization" className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm placeholder:text-gray-400 focus:ring-transparent sm:text-sm sm:leading-6"/>
                        </div>
                      </div>
                      <div className="sm:col-span-3">
                        <label htmlFor="email" className="block text-sm font-medium leading-6 text-white">Email</label>
                        <div className="mt-2">
                          <input type="email" name="email" id="email" value={email} onChange={(e) => setEmail(e.target.value)} required autoComplete="email" className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm placeholder:text-gray-400 focus:ring-transparent sm:text-sm sm:leading-6"/>
                        </div>
                      </div>
                      <div className="sm:col-span-3">
                        <label htmlFor="province" className="block text-sm font-medium leading-6 text-white">Província</label>
                        <div className="mt-2">
                          <input type="text" name="province" id="province" value={province} onChange={(e) => setProvince(e.target.value)} required autoComplete="address-level1" className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm placeholder:text-gray-400 focus:ring-transparent sm:text-sm sm:leading-6"/>
                        </div>
                      </div>
                      <div className="sm:col-span-3">
                        <label htmlFor="streetAddress" className="block text-sm font-medium leading-6 text-white">Endereço</label>
                        <div className="mt-2">
                          <input type="text" name="streetAddress" id="streetAddress" value={streetAddress} onChange={(e) => setStreetAddress(e.target.value)} required autoComplete="street-address" className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm placeholder:text-gray-400 focus:ring-transparent sm:text-sm sm:leading-6"/>
                        </div>
                      </div>
                      <div className="sm:col-span-3">
                        <label htmlFor="nifEmpresa" className="block text-sm font-medium leading-6 text-white">NIF</label>
                        <div className="mt-2">
                          <input type="text" name="nifEmpresa" id="nifEmpresa" value={nifEmpresa} onChange={(e) => setNifEmpresa(e.target.value)} required autoComplete="off" className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm placeholder:text-gray-400 focus:ring-transparent sm:text-sm sm:leading-6"/>
                        </div>
                      </div>
                      <div className="sm:col-span-3">
                        <label htmlFor="actuacao" className="block text-sm font-medium leading-6 text-white">Área de Actuação</label>
                        <div className="mt-2">
                          <select id="actuacao" name="actuacao" value={actuacao} onChange={(e) => setActuacao(e.target.value)} required autoComplete="off" className="block w-full rounded-md border-0 py-1.5 bg-transparent text-white shadow-sm focus:ring-transparent sm:text-sm sm:leading-6">
                            <option value=""></option>
                            {areasAtuacaoData.areas && areasAtuacaoData.areas.map((area, index) => (
                              <option key={index} value={area}>{area}</option>
                            ))}
                          </select>
                        </div>
                      </div>
                      <div className="sm:col-span-3">
                        <label htmlFor="telefone" className="block text-sm font-medium leading-6 text-white">Telefone</label>
                        <div className="mt-2">
                          <input type="text" name="telefone" id="telefone" value={telefone} onChange={(e) => setTelefone(e.target.value)} minLength={9} maxLength={9} required autoComplete="tel" className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm placeholder:text-gray-400 focus:ring-transparent sm:text-sm sm:leading-6"/>
                        </div>
                      </div>
                      <div className="sm:col-span-3">
                        <label htmlFor="password" className="block text-sm font-medium leading-6 text-white">Senha</label>
                        <div className="mt-2">
                          <input id="password" name="password" type="password" value={password} onChange={(e) => setPassword(e.target.value)} autoComplete="current-password" required className="block w-full rounded-md border-0 py-1.5 text-gray-900 shadow-sm placeholder:text-gray-400 focus:ring-transparent sm:text-sm sm:leading-6"/>
                        </div>
                      </div>
                    </div>
                  </div>
                  <div className="flex items-center justify-end gap-x-6">
                    <button type="button" className="text-sm font-semibold leading-6 text-white">Cancelar</button>
                    <button type="submit" className="rounded-md bg-indigo-600 px-3 py-2 text-sm font-semibold text-white shadow-sm hover:bg-indigo-500 focus:ring-transparent">Registrar</button>
                  </div>
                </form>
              </div>
            </div>
          </div>
        </div>
      </section>
      {showSuccessModal && (
        <div className={styles.modal}>
          <div className={styles.modalContent}>
            <h2>Registro bem-sucedido!</h2>
            <button onClick={() => setShowSuccessModal(false)}>Fechar</button>
          </div>
        </div>
      )}
      {showErrorModal && (
        <div className={styles.modal}>
          <div className={styles.modalContent}>
            <h2>Ocorreu um erro no registro!</h2>
            <button onClick={() => setShowErrorModal(false)}>Fechar</button>
          </div>
        </div>
      )}
    </>
  );
}
